import React from 'react';

const Song = ({ id, title, artist, duration }) => {
  return (
    <li className="flex justify-between items-center py-2 border-b border-gray-300">
      <div>
        <h3 className="text-xl font-bold text-teal">{title}</h3>
        <p className="text-gray-500">{artist}</p>
        <p className="text-gray-500">{duration}</p>
      </div>
      {/* You can add any additional buttons/icons here */}
    </li>
  );
};

export default Song;
